import { useRef } from 'react';

export default function Nft() {

  const htmlContent = `<html>
  <body>
      <div>
          <img src="data:image/png;base64, "/>
      </div>
  </body>
</html>
`;
  
  const containerRef = useRef<HTMLDivElement>(null);

  return (
    <div
    ref={containerRef}
    dangerouslySetInnerHTML={{ __html: htmlContent }}
    />
);
} 